import { Button } from '@material-ui/core';
import React, { useState, useEffect } from 'react';



export const UserDashboard = () => {

    const [profile, setProfile] = useState(false);
    const [list, setList] = useState(false)


    const profileHandler = () => {
        if (profile != true) {
            setProfile(true)
            setList(false)
        } else {
            setProfile(false)

        }
    }
    const listHandler = () => {
        if (list != true) {
            setList(true)
            setProfile(false)
        } else {
            setList(false)
        }

    }


    return (
        <>
            <div className="falla">
                <div className="user">
                    <div className="userDashboard">
                        <div className="userProfile">
                            <div onClick={profileHandler} className={`userBack ${profile && 'openProfile'}`}>
                                <p>TUPERFIL</p>
                            </div>
                        </div>
                        <div className="userProfile">
                            <div >
                                <p onClick={listHandler} className={`userBack ${list && 'openProfile'}`}>TULISTA</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
